import React from "react"
class Item extends React.Component {
    render() {
        var { tasks, index } = this.props
        return (
            <tr>
                <td>{index}</td>
                <td>{tasks.name}</td>
                <td>

                </td>
                <td></td>
            </tr>



        )
    }
}

export default Item
